import { Button } from "lively.morphic/components/buttons.js";

export default class SaveButton extends Button {
  trigger() {
    super.trigger();    
    var target = this.owner.owner.submorphs.filter(function(ea){
      return ea.name == 'container'
    })[0]
    var saveTarget = this.owner.owner.owner.saveTarget
    var obj = {}
    target.submorphs.forEach(function(ea){      
      if (ea.name.indexOf('_value') >= 0){
        var key = ea.name.split('_value')[0]
        var value;
        if (key != 'tt'){
          value = ea.textString
        }        
        obj[key] = value
      }      
    })
    obj['tt'] = saveTarget.getPlayerInfo(obj)
    saveTarget.data.nodes.update(obj)
  }
}

